description:
&quot;The Sandbox is a world building &amp; crafting game featuring over 150+ physics elements presented in 2D pixel blocks that can interact with each others. Players can craft amazing worlds, create pixel art, chain reactions, chiptune music, advanced contraptions, electric circuits or just play with physics.
Play with basic elements ranging from simple water, stone, sand, wood, glass, lava, fire, to more complex: electricity, metal, virus, antivirus,heater, cooler, lasers, pipes, gems, sensors, leds TNT, C4, crosswire, conveyor belt, music instruments etc.&quot;

